import React from 'react';
import './dealedit.css';

class DealEdit extends React.Component {
	constructor(props) {
		super(props);


	}

	onCancel() {
		this.props.handleDealNoAdd();
	}

	render() {
		return (

			<div className="container"> 
			  <div className="dealslist">
			DEAL EDIT
			    <input 
			    	type="text" 
			    	className="plug" 
			    	placeholder="TENANT NAME" 
			    	name="tenant" 
			    />

			    <input 
			    	type="text" 
			    	className="plug" 
			    	placeholder="ID" 
			    	name="id" 
			    />  
			    <input
			    	type="button"
			    	className="plug"
			    	placeholder="Cancel"
			    	name="cancel"
			    	onClick= {this.props.handleDealNoAdd()}
			    />
			    </div>
			</div>
		);
	}
}

export default DealEdit;
